import { createSlice } from "@reduxjs/toolkit";

const slice = createSlice({
  name: "user",
  initialState: { user: null },
  reducers: {
    LOGIN_REQUEST: (state, action) => {},
  },
});

export const { LOGIN_REQUEST } = slice.actions;
export default slice.reducer;
